  <text class="cls-3" transform="translate(69.6 72.5)">The DT-48s from Be<tspan x="163.7" y="0">y</tspan><tspan x="173.4" y="0">erdynamic became the first dynamic headphones </tspan><tspan x="0" y="21.6">to hit the market. Though it would be a few decades before electrostatic </tspan><tspan x="0" y="43.2">headphones came into play, this </tspan><tspan x="261.1" y="43.2">w</tspan><tspan x="275.7" y="43.2">as obviously a huge leap for</tspan><tspan x="499.1" y="43.2">w</tspan><tspan x="513.7" y="43.2">ard in </tspan><tspan x="0" y="64.8">the can story. Dynamic headphones are, to this day, the most popular </tspan><tspan x="0" y="86.4">type on the market </tspan></text>
